import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import './styles/index.css'
import {CssBaseline,ThemeProvider} from '@material-ui/core'
ReactDOM.render(
<CssBaseline>
    <ThemeProvider>
        <App />
    </ThemeProvider>

</CssBaseline>, document.getElementById('root'));
